import React, { useEffect, useRef } from 'react';
import resume from '../resume/resumeData.json';

function About() {
  const aboutRef = useRef(null);
  const elementsRef = useRef([]);

  useEffect(() => {
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            entry.target.classList.add('animate-in');
          }
        });
      },
      { threshold: 0.1 }
    );

    elementsRef.current.forEach((el) => {
      if (el) observer.observe(el);
    });

    return () => observer.disconnect();
  }, []);

  const addToRefs = (el) => {
    if (el && !elementsRef.current.includes(el)) {
      elementsRef.current.push(el);
    }
  };

  return (
    <section className="about-section" ref={aboutRef}>
      <div className="about-hero">
        <div 
          className="hero-content animate-element"
          ref={addToRefs}
          style={{ animationDelay: '0.1s' }}
        >
          <h1 className="hero-name">{resume.name}</h1>
          <div className="typing-container">
            <div className="professional-title-animated">{resume.title}</div>
          </div>
        </div>

        <div 
          className="summary-container animate-element"
          ref={addToRefs}
          style={{ animationDelay: '0.3s' }}
        >
          <p className="summary-text-animated">{resume.summary}</p>
        </div>
      </div>

      <div className="contact-section-animated">
        <h3 
          className="contact-title animate-element"
          ref={addToRefs}
          style={{ animationDelay: '0.5s' }}
        >
          Let's Connect
        </h3>
        <div className="contact-grid">
          <div 
            className="contact-card animate-element"
            ref={addToRefs}
            style={{ animationDelay: '0.7s' }}
          >
            <div className="contact-icon">üìß</div>
            <div className="contact-content">
              <div className="contact-label">Email</div>
              <div className="contact-value">{resume.contact.email}</div>
            </div>
          </div>

          <div 
            className="contact-card animate-element"
            ref={addToRefs}
            style={{ animationDelay: '0.8s' }}
          >
            <div className="contact-icon">üì±</div>
            <div className="contact-content">
              <div className="contact-label">Phone</div>
              <div className="contact-value">{resume.contact.phone}</div>
            </div>
          </div>

          <div 
            className="contact-card animate-element"
            ref={addToRefs}
            style={{ animationDelay: '0.9s' }}
          >
            <div className="contact-icon">üìç</div>
            <div className="contact-content">
              <div className="contact-label">Location</div>
              <div className="contact-value">{resume.contact.location}</div>
            </div>
          </div>

          <a 
            href={resume.contact.linkedin}
            className="contact-card contact-link animate-element"
            ref={addToRefs}
            style={{ animationDelay: '1.0s' }}
            target="_blank"
            rel="noopener noreferrer"
          >
            <div className="contact-icon">üíº</div>
            <div className="contact-content">
              <div className="contact-label">LinkedIn</div>
              <div className="contact-value">Connect with me</div>
            </div>
          </a>

          <a 
            href={resume.contact.github}
            className="contact-card contact-link animate-element"
            ref={addToRefs}
            style={{ animationDelay: '1.1s' }}
            target="_blank"
            rel="noopener noreferrer"
          >
            <div className="contact-icon">üíª</div>
            <div className="contact-content">
              <div className="contact-label">GitHub</div>
              <div className="contact-value">View my code</div>
            </div>
          </a>
        </div>
      </div>
    </section>
  );
}

export default About;
